import { Listrules } from "./Listrules";
import { Examrules } from "./Examrules";
import { Link } from "react-router-dom";
import React, { useState } from "react";
import "./Agreeform.css";
export const Agreeform = () => {
  const [agree, setAgree] = useState(false);
  const [myanname, setMyanname] = useState("");
  const [engname, setEngname] = useState("");
  const [nrc, setNrc] = useState("");
  const [birthDay, setBirthDay] = useState("");
  const [nation, setNation] = useState("");
  const [seatno, setSeatNo] = useState("");
  const [score, setScore] = useState("");
  const [passedseat_no, setPassedSeatNo] = useState("");
  const [currentseat_no, setCurrentSeatNo] = useState("");
  const [myanfathername, setMyanFatherName] = useState("");
  const [engfathername, setEngFatherName] = useState("");
  const [fathernrc, setFatherNrc] = useState("");
  const [fathernation, setFatherNation] = useState("");
  const [fatherjob, setFatherJob] = useState("");
  const [mothername, setMotherName] = useState("");
  const [mothernrc, setMotherNrc] = useState("");
  const [mothernation, setMotherNation] = useState("");
  const [motherjob, setMotherJob] = useState("");
  const [address, setAddress] = useState("");
  const [student_no, setStudentNo] = useState("");
  const [phone_no, setPhoneNo] = useState("");
  const [email, setEmail] = useState("");

  /* const handleFileChange = (e) => {
    const selectedFile = e.target.files[0];
    setPhoto(selectedFile); */

  /*  const reader = new FileReader();
  reader.onloadend = () => {
    setPhotoPreview(reader.result);
  };
  if (selectedFile) {
    reader.readAsDataURL(selectedFile);
  } else {
    setPhotoPreview(null);
  }
 */
  /* const fileInput = e.target;
    if (fileInput.files.length > 0) {
      fileInput.labels[0].innerText = fileInput.files[0].name;
    } */

  const btnHandler = (e) => {
    alert("Check your Email! We have already sent your ID Number");

    e.preventDefault();

    const formData = new URLSearchParams();
    formData.append("myanname", myanname);
    formData.append("engname", engname);
    formData.append("nrc", nrc);
    formData.append("birthDay", birthDay);
    formData.append("nation", nation);
    formData.append("seatno", seatno);
    formData.append("score", score);
    formData.append("passedseat_no", passedseat_no);
    formData.append("currentseat_no", currentseat_no);
    formData.append("myanfathername", myanfathername);
    formData.append("engfathername", engfathername);
    formData.append("fathernrc", fathernrc);
    formData.append("fathernation", fathernation);
    formData.append("fatherjob", fatherjob);
    formData.append("mothername", mothername);
    formData.append("mothernrc", mothernrc);
    formData.append("mothernation", mothernation);
    formData.append("motherjob", motherjob);
    formData.append("address", address);
    formData.append("phone_no", phone_no);
    formData.append("student_no", student_no);
    formData.append("email", email);

    setMyanname("");
    setEngname("");
    setNrc("");
    setBirthDay("");
    setNation("");
    setSeatNo("");
    setScore("");
    setPassedSeatNo("");
    setCurrentSeatNo("");
    setMyanFatherName("");
    setEngFatherName("");
    setFatherNrc("");
    setFatherNation("");
    setFatherJob("");
    setMotherName("");
    setMotherNrc("");
    setMotherNation("");
    setMotherJob("");
    setAddress("");
    setStudentNo("");
    setPhoneNo("");
    setEmail("");

    /* alert(
      "You registered successfully! Then click Next button and read the university rules. "
    ); */
    Axios.post(
      "http://127.0.0.1:8000/student_registration/second_year",
      formData
      /*
       */
      /* { headers: { "Content-Type": "application/x-www-form-urlencoded" } } */
    )
      .then((response) => {
        const newItemId = response.data.id;
        alert(
          `You registered successfully! Then click Next button and read the university rules and fill this ID ${newItemId} in the Fill ID form.`
        );
        console.log("Data sent successfully. New item ID:", newItemId);
        /* console.log("Data sent successfully:", response.data); */
      })
      .catch((error) => {
        console.error("Error sending data:", error);
      });
  };
  const checkboxHandler = () => {
    setAgree(!agree);
  };

  return (
    <>
      <form>
        <h1>ကတိ၀န်ခံချက်</h1>
        <h6>
          ကျွန်တော်/ကျွန်မတို့သည် အောက်ဖော်ပြပါစည်းကမ်းများကို
          သိရှိသဘောပေါက်ကြောင်း သဘောတူပါသည်။
        </h6>
        <br />
        <div className="rules">
          <Listrules />
          <Examrules />
        </div>
        <div className="check">
          <input type="checkbox" id="agree" onChange={checkboxHandler} />
          <strong>
            {" "}
            <label htmlfor="agree">
              အထက်ဖော်ပြပါစည်းကမ်းများကို သိရှိသဘောပေါက်နားလည်လက်ခံပါသဖြင့်
              ကျွန်တော်/မ သည် တသွေမသိမ်း လိုက်နာပါမည်။
            </label>
          </strong>
        </div>
        <Link to="/fillId">
          <button className="btn" disabled={!agree} onClick={btnHandler}>
            Continue
          </button>{" "}
        </Link>
      </form>
    </>
  );
};
